import React from 'react';

const UserData = props => {
    return (
        <div className='myUserData-container'>
            <h3>{props.userData.name}</h3>
            <img 
                src={props.user.avatar_url}
                className='profile-photo'
                href={props.user.url}
                alt='User Portrait'
            ></img>
            <h5>{props.userData.login}</h5>
        </div>
    );
};

export default UserData;
